import {makeAutoObservable} from "mobx";

export default class DeviceStore {
    constructor() {
        this._types = [
            {id: 1, name: 'Холодильники'},
            {id: 2, name: 'Смартфоны'},
            {id: 2, name: 'Смартфоны'},
            {id: 2, name: 'Смартфоны'}
        ]
        this._brands = [
            {id: 1, name: 'Samsung'},
            {id: 2, name: 'Apple'}
        ]
        this._devices = [
            {id: 1, name: 'Iphone 12 pro', price: 25000, rating: 5, img: `https://www.91-img.com/gallery_images_uploads/2/7/2736acf8e6adc92cf6970c457d2112c6a7a65767.JPG?tr=h-550,w-0,c-at_max`},
            {id: 2, name: 'Iphone 12 pro', price: 25000, rating: 5, img: `https://www.91-img.com/gallery_images_uploads/2/7/2736acf8e6adc92cf6970c457d2112c6a7a65767.JPG?tr=h-550,w-0,c-at_max`},
            {id: 3, name: 'Iphone 12 pro', price: 25000, rating: 5, img: `https://www.91-img.com/gallery_images_uploads/2/7/2736acf8e6adc92cf6970c457d2112c6a7a65767.JPG?tr=h-550,w-0,c-at_max`},
            {id: 4, name: 'Iphone 12 pro', price: 25000, rating: 5, img: `https://www.91-img.com/gallery_images_uploads/2/7/2736acf8e6adc92cf6970c457d2112c6a7a65767.JPG?tr=h-550,w-0,c-at_max`}
        ]
        makeAutoObservable(this)
    }

    setTypes(types) {
        this._types = types
    }
    setBrands(brands) {
        this._brands = brands
    }
    setDevices(devices) {
        this._devices = devices
    }

    get types() {
        return this._types
    }
    get brands() {
        return this._brands
    }
    get devices() {
        return this._devices
    }
}
